import React, { Component } from 'react';
import './App.css';

class App extends Component{
  constructor(){
    super();
    this.state = {
      character: null
    }
  }

  componentDidMount() {
    fetch('https://rickandmortyapi.com/api/character/ ').then((respones) => {
      respones.json().then((result) => {
        console.warn(result)  
        this.setState({
          character:result
        })
      })
    })
  }

  render() {
    return(
      <div>
        {
          this.state.character?
          this.state.character.map((list, i) => 
          <div>
            <p>{i}</p>
          </div>
          )
          :
          null
        }
      </div>
    )
  }
}



export default App;
